import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles/main.css';
import Console from './Components/Console';

const e = React.createElement;

class App extends React.Component {

  constructor(props){
    super(props);

    this.state = {
      console:[],
      epochs:30
    }
  }
  render(){
    return (
      e('div',{className:'container c-design'},
        e('div',{className:'row'},
          e('div',{className:'col-md-6 content-console'},
            e('p',null,'Console'),
            <Console value = {this.state.console}/>,
            e('button',{},'Clear')
            ),
          e('div',{className:'col-md-6 content-admin'},
            e('p',{},'Train')
          ),

        )
      )
    );
  }
}




export default App;
